(103, 1, '2021-02-02 14:08:15', '2021-02-02 13:08:15', 'Le <b>Carnaval de Rio</b> est l\'événement touristique le plus important de la municipalité de Rio et la fête nationale la plus populaire au <a title=\"Brésil\" href=\"https://fr.wikipedia.org/wiki/Br%C3%A9sil\">Brésil</a>, en particulier à <a title=\"Rio de Janeiro\" href=\"https://fr.wikipedia.org/wiki/Rio_de_Janeiro\">Rio de Janeiro</a>. Il est devenu un vrai synonyme de la célébration du <a title=\"Carnaval\" href=\"https://fr.wikipedia.org/wiki/Carnaval\">carnaval</a> dans le pays et même au monde. Il a lieu tous les ans durant les 4 jours qui précèdent le <a title=\"Mercredi des Cendres\" href=\"https://fr.wikipedia.org/wiki/Mercredi_des_Cendres\">mercredi des Cendres</a>, qui est le jour qui marque le début du carême.', 'Carnaval', '', 'publish', 'open', 'closed', '', 'carnaval', '', '', '2021-02-09 14:17:57', '2021-02-09 13:17:57', '', 0, 'http://localhost/unit2/moncms/?post_type=product&#038;p=103', 0, 'product', '', 0),
