(308, 1, '2021-02-09 14:02:44', '2021-02-09 13:02:44', '<span class=\"ILfuVd\"><span class=\"hgKElc\"><b>São João</b> (saint Jean) compte parmi les <b>fêtes</b> les plus populaires du <b>Brésil</b>. ... Au <b>Brésil</b>, le 24 juin ne marque pas le début de l\'été, mais de l\'hiver, saison des pluies au Nordeste. Donc, dans le « sertão » semi-aride de Campina Grande et Caruaru, la <b>fête</b> est plutôt liée à l\'arrivée de la pluie salvatrice.</span></span>', 'São João', '', 'publish', 'open', 'closed', '', 'sao-joao', '', '', '2021-02-09 14:16:05', '2021-02-09 13:16:05', '', 0, 'http://localhost/unit2/moncms/?post_type=product&#038;p=308', 0, 'product', '', 0),
