(312, 1, '2021-02-09 14:18:52', '2021-02-09 13:18:52', 'Le <b>rafting</b><sup id=\"cite_ref-GDT_1-0\" class=\"reference\"><a href=\"https://fr.wikipedia.org/wiki/Rafting#cite_note-GDT-1\">1</a></sup><sup class=\"reference cite_virgule\">,</sup><sup id=\"cite_ref-2\" class=\"reference\"><a href=\"https://fr.wikipedia.org/wiki/Rafting#cite_note-2\">2</a></sup><sup class=\"reference cite_virgule\">,</sup><sup id=\"cite_ref-3\" class=\"reference\"><a href=\"https://fr.wikipedia.org/wiki/Rafting#cite_note-3\">3</a></sup> (de l\'anglais <i><span class=\"lang-en\" lang=\"en\">to raft</span></i> « traverser, descendre (un fleuve) en radeau »)<sup id=\"cite_ref-4\" class=\"reference\"><a href=\"https://fr.wikipedia.org/wiki/Rafting#cite_note-4\">4</a></sup>, ou le <b>raft</b> (abréviation familière), est une activité de <a title=\"Loisir\" href=\"https://fr.wikipedia.org/wiki/Loisir\">loisir</a> ou un <a title=\"Sport\" href=\"https://fr.wikipedia.org/wiki/Sport\">sport</a> qui consiste à descendre des sections de rivière à rapides dans un radeau pneumatique (<i>inflatable raft</i>) manié soit à la <a title=\"Pagaie\" href=\"https://fr.wikipedia.org/wiki/Pagaie\">pagaie</a> par plusieurs équipiers (<i>rafters</i>), soit à l\'<a title=\"Aviron (rame)\" href=\"https://fr.wikipedia.org/wiki/Aviron_(rame)\">aviron</a> par un seul individu, ou même exceptionnellement à l\'aide de moteurs sur de très grosses rivières. En <a class=\"mw-disambig\" title=\"Eau vive\" href=\"https://fr.wikipedia.org/wiki/Eau_vive\">eau vive</a> (aérée), on pratique le <b>radeau en eau vive</b> (<i><span class=\"lang-en\" lang=\"en\">white-water rafting</span></i>', 'Rafting dans les fleuves du Pantanal', '', 'publish', 'open', 'closed', '', 'rafting', '', '', '2021-02-09 17:03:49', '2021-02-09 16:03:49', '', 0, 'http://localhost/unit2/moncms/?post_type=product&#038;p=312', 0, 'product', '', 0),
(313, 1, '2021-02-09 15:10:37', '2021-02-09 14:10:37', 'L’<b>escalade</b>, ou <b>grimpe</b>, parfois appelée <b>varappe</b> (désuet)<sup id=\"cite_ref-2\" class=\"reference\"><a href=\"https://fr.wikipedia.org/wiki/Escalade#cite_note-2\">Note 1</a></sup>, est une <a title=\"Pratique\" href=\"https://fr.wikipedia.org/wiki/Pratique\">pratique</a> et un <a title=\"Sport\" href=\"https://fr.wikipedia.org/wiki/Sport\">sport</a> consistant à progresser le long d\'une paroi pour atteindre le haut d\'un <a title=\"Relief (géomorphologie)\" href=\"https://fr.wikipedia.org/wiki/Relief_(g%C3%A9omorphologie)\">relief</a> ou d\'une <a title=\"Mur d\'escalade\" href=\"https://fr.wikipedia.org/wiki/Mur_d%27escalade\">structure artificielle</a> par un cheminement appelé <a title=\"Voie d\'escalade\" href=\"https://fr.wikipedia.org/wiki/Voie_d%27escalade\">voie</a>, avec ou sans l\'aide de <a title=\"Matériel d\'escalade\" href=\"https://fr.wikipedia.org/wiki/Mat%C3%A9riel_d%27escalade\">matériel</a>. Le terrain de pratique va des <a title=\"Bloc (escalade)\" href=\"https://fr.wikipedia.org/wiki/Bloc_(escalade)\">blocs</a> de faible hauteur aux <a title=\"Big wall\" href=\"https://fr.wikipedia.org/wiki/Big_wall\">parois de plusieurs centaines de mètres</a>, en passant par les murs d\'escalade. Le pratiquant est couramment appelé « grimpeur »', 'Escalade à la Chapada Diamantina', '', 'publish', 'open', 'closed', '', 'escalade-a-la-chapada-diamantina', '', '', '2021-02-09 15:21:33', '2021-02-09 14:21:33', '', 0, 'http://localhost/unit2/moncms/?post_type=product&#038;p=313', 0, 'product', '', 0),
(314, 1, '2021-02-09 15:11:38', '2021-02-09 14:11:38', 'Le <b>chamanisme</b> se présente comme une pratique centrée sur la médiation entre les êtres humains et les <a title=\"Esprit (surnaturel)\" href=\"https://fr.wikipedia.org/wiki/Esprit_(surnaturel)\">esprits</a>. C\'est le <a title=\"Chaman\" href=\"https://fr.wikipedia.org/wiki/Chaman\">chaman</a> qui incarne cette fonction, dans le cadre d\'une interdépendance étroite avec la communauté qui le reconnaît comme tel et pour laquelle il intercède auprès des esprits.', 'Expérience chamanique en Amazonie', '', 'publish', 'open', 'closed', '', 'experience-chamanique-en-amazonie', '', '', '2021-02-09 16:59:20', '2021-02-09 15:59:20', '', 0, 'http://localhost/unit2/moncms/?post_type=product&#038;p=314', 0, 'product', '', 0),
