(353, 1, '2021-02-09 16:58:07', '2021-02-09 15:58:07', 'Le <b>chamanisme</b> se présente comme une pratique centrée sur la médiation entre les êtres humains et les <a title=\"Esprit (surnaturel)\" href=\"https://fr.wikipedia.org/wiki/Esprit_(surnaturel)\">esprits</a>. C\'est le <a title=\"Chaman\" href=\"https://fr.wikipedia.org/wiki/Chaman\">chaman</a> qui incarne cette fonction, dans le cadre d\'une interdépendance étroite avec la communauté qui le reconnaît comme tel et pour laquelle il intercède auprès des esprits.', 'Expérience chamanique en Amazonie', '', 'inherit', 'closed', 'closed', '', '314-autosave-v1', '', '', '2021-02-09 16:58:07', '2021-02-09 15:58:07', '', 314, 'http://localhost/unit2/moncms/index.php/2021/02/09/314-autosave-v1/', 0, 'revision', '', 0),
